+--------+-------------------------------------------+--------+
|c       |Format: A200                               |       3|
+--------+-------------------------------------------+--------+
|d       |Format: A32767                             |       4|
+--------+-------------------------------------------+--------+

EOF
if [ $? -ne 0 ] ; then fail ; fi


pass;
